No.8 @tgreurope GR010-Hybrid Hypercar driven at the chequered flag by @sebastien_buemi takes victory in the WEC 8 Hours of Portimao.

@jamescalado celebrates 32nd birthday with champagne as he and teammate @ale_pierguidi in No.51 @afcorse_official  @ferrariraces lead majority of race to bounce back from Spa disappointment.

@jota_sport takes memorable 1-2 result as No.38 Oreca-Gibson of @afelixdacosta, Anthony Davidson and @robgonzalezv take incredible last gasp victory.

@cetilar_racing Ferrari take first victory in WEC with controlled to race head home Team Project 1 Porsche by just eight seconds.

